/*drawingTool*/
function drawing(canvasId) {
   var canvas = $(canvasId)[0]; //Collage
	var drawingToolCtxt = canvas.getContext('2d');
   var layers = new Array();

	this.addLayer = function(img, operation) {
		var layer = new Layer(img,operation);
		layers.push(layer);
		redrawCanvas();
		return layer;
	}
	this.redraw = function() {
		redrawCanvas();
	}
	this.getCanvas = function() {
		return canvas;
	}
	this.getLayers = function() {
		return layers;
	}
	this.getLayer = function(i) {
	//console.log(layers);
		return layers[i];
	}
	this.removeLayer = function(i) {
		i = parseInt(i);
		if (i >= 0 && i < layers.length) {
			layers.splice(i,1);
			//redrawCanvas();
		}
	}
	
	function redrawCanvas() {
		drawingToolCtxt.clearRect(0,0,canvas.width, canvas.height);	
	
		for (i in layers) {
		console.log(layers);
			if (layers[i].isVisible()) {
				drawingToolCtxt.save();
				drawingToolCtxt.globalAlpha = layers[i].getOpacity();
				drawingToolCtxt.globalCompositeOperation = layers[i].getCompositeOperation();
			/*	
				//context.globalCompositeOperation = 'source-over';
				//context.translate(layers[i].offsetX + (layers[i].width / 2), layers[i].offsetY + (layers[i].height / 2));
				//context.drawImage(layers[i].getCanvas(), 0 - (layers[i].width / 2), 0 - (layers[i].height / 2));
				*/
				/*
				 
				  http://www.whatwg.org/specs/web-apps/current-work/multipage/the-canvas-element.html#dom-context-2d-drawimage
				*/
				// Source image
				var sx =0; 
				var sy= 0 ; 
				var sw= 760 ;
				var sh= 683 ;
				// Destination Canvas
				var dx= 140; 
				var dy =-40; 
				var dw =612 ;
				var dh =550;
				drawingToolCtxt.drawImage(layers[i].getCanvas(),sx,sy,sw,sh,dx,dy,dw,dh);

				//context.restore();
			}
		}
	}
};
/*Layers*/
function Layer(img, operation) {
	this.img = img;	
	this.offsetX = 0;
	this.offsetY = 0;
	this.width = img.naturalHeight;
	this.height = img.naturalHeight;
	this.canvas = document.createElement('canvas');
	this.canvas.width = this.width;
	this.canvas.height = this.height;	
	this.context = this.canvas.getContext('2d');
	this.context.save();
	this.context.translate(this.width / 2, this.height / 2);
	this.opacity = 1;
	this.visible = true;
	this.compositeOperation = operation;
	this.title = "";
	this.isVisible = function() {
		return this.visible;
	}
	this.setVisible = function(visible) {
		this.visible = visible;
	}
	this.toggleVisible = function() {
		this.visible = !this.visible;
	}	
	this.getOpacity = function() {
		return this.opacity;
	}
	this.setOpacity = function(opacity) {
		this.opacity = opacity;
	}
	this.getImage = function() {
		return this.img;
	}
	this.setCompositeOperation = function(compositeOperation) {
		this.compositeOperation = compositeOperation;
	}
	this.getCompositeOperation = function() {
		return this.compositeOperation;
	}
	this.redraw = function() {
		var startX = this.width / 2 - this.width;
		var startY = this.height / 2 - this.height;

		this.context.clearRect(startX, startY, this.canvas.width, this.canvas.height);
		this.context.drawImage(this.img, startX, startY, this.width, this.height);
		//console.log(this.context.drawImage(this.img, startX, startY, this.width, this.height));
	}
	this.getCanvas = function() {
		this.redraw();
		return this.canvas;
	}
	this.getWidth = function(){
		return this.width;
	}
	this.getHeight = function(){
		return this.height;
	}
}

